CREATE TABLE IF NOT EXISTS `#__cubic_cubes` (
`id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
`ordering` INT(11)  NOT NULL ,
`state` TINYINT(1)  NOT NULL ,
`checked_out` INT(11)  NOT NULL ,
`checked_out_time` DATETIME NOT NULL DEFAULT '0000-00-00 00:00:00',
`created_by` INT(11)  NOT NULL ,
`cube_name` VARCHAR(255)  NOT NULL ,
`cube_value` INT(11)  NOT NULL ,
PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT COLLATE=utf8_general_ci;

CREATE TABLE IF NOT EXISTS `#__cubic_categories` (
`id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
`ordering` INT(11)  NOT NULL ,
`state` TINYINT(1)  NOT NULL ,
`checked_out` INT(11)  NOT NULL ,
`checked_out_time` DATETIME NOT NULL DEFAULT '0000-00-00 00:00:00',
`created_by` INT(11)  NOT NULL ,
`cat_name` VARCHAR(255)  NOT NULL ,
`parent_category` INT(11) NOT NULL ,
`thumb` VARCHAR(255)  NOT NULL ,
PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT COLLATE=utf8_general_ci;

CREATE TABLE IF NOT EXISTS `#__cubic_items` (
`id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
`asset_id` INT(10) UNSIGNED NOT NULL DEFAULT '0',
`ordering` INT(11)  NOT NULL ,
`state` TINYINT(1)  NOT NULL ,
`checked_out` INT(11)  NOT NULL ,
`checked_out_time` DATETIME NOT NULL DEFAULT '0000-00-00 00:00:00',
`created_by` INT(11)  NOT NULL ,
`item_name` VARCHAR(255)  NOT NULL ,
`item_subtitle` VARCHAR(255)  NOT NULL ,
`item_type` INT(11)  NOT NULL ,
`category` TEXT NOT NULL ,
`thumb` VARCHAR(255)  NOT NULL ,
`cost` FLOAT NOT NULL ,
`item_size` INT(11)  NOT NULL ,
`item_weight` int(11) default NULL,
`uid` INT(11)  NOT NULL ,
PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT COLLATE=utf8_general_ci;

CREATE TABLE `#__cubic_inventories` (
  `id` int(11) unsigned NOT NULL auto_increment,
  `created_by` int(11) NOT NULL,
  `username` varchar(255) NOT NULL,
  `created` datetime default '0000-00-00 00:00:00',
  `last_updated` datetime default '0000-00-00 00:00:00',
  `user_id` int(11) default '0',
  `rooms` int(11) default NULL,
  `zip_from` int(11) default NULL,
  `zip_to` int(11) default NULL,
  `date_move` date default NULL,
  `phone` int(11) default NULL,
  `email` varchar(255) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `#__cubic_savedorders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `orderdata` text CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=latin1;



